import styled from "styled-components";

export const WrapperLabelText = styled.h3`
    color: rgb(56,56,61);
    font-size: 14px;
    font-weight: 500;
`

export const WrapperText = styled.span`
    color: rgb(56,56,61);
    font-size: 12px;
    font-weight: 400;
`
export const WrapperContent = styled.div`
    display: flex;
    // align-items: center;
    flex-direction: column;
    gap: 12px;
`
export const WrapperTextPrice = styled.div`
    padding: '4px';
    borderRadius: '4px';
    backgroundColor: 'rgb(238,238,238';
    width: 'fit-content'
`
